function initalizeRestaurantReviewPage(){fetchDataFromURL((e,r,t)=>{if(e)console.error(e);else{const e=document.getElementById("restaurant-title");e.innerText=t?`Do you really want to edit review no '${t.id}' for '${r.name}'?`:`Will you please write a new review for '${r.name}'?`}})}window.addEventListener("load",e=>{initalizeRestaurantReviewPage()}),fetchDataFromURL=(e=>{if(self.restaurant)return void e(null,self.restaurant);const r=UrlHelper.getParameterByName("restaurant_id");r?DBHelper.fetchRestaurantById(r,(t,n)=>{if(t)return e(t);if(!n)return e(`Restaurant with id '${r}' cound not be found!`);self.restaurant=n,self.review=null;const a=UrlHelper.getParameterByName("review_id");if(!a)return e(null,n);DBHelper.fetchReviewById(a,(r,t)=>r?e(r,n):t?(self.review=t,e(null,n,t)):e(`Review with id '${a}' cound not be found!`,n))}):(error="No restaurant id in URL",e(error,null))});